                                        "title": "RM ---  Under 34 Code of Federal Regulations (CFR) §300.320(a)(6) and 19 Texas Administrative Code (TAC)§89.1055, if the ARD committee determines that the student will take STAAR Alternate 2, the IEP must provide a statement of why the student cannot participate in the general assessment (STAAR) with or without allowable accommodations, and why the alternate assessment is appropriate for the student, including that all of the eligibility criteria are met.",
